async function getRoute() {
  const query = await fetch(
    `https://api.mapbox.com/directions/v5/mapbox/driving/${startLocation[0]},${startLocation[1]};${endLocation.lon},${endLocation.lat}?steps=true&geometries=geojson&access_token=${mapboxgl.accessToken}`,
    { method: 'GET' }
  );
  const json = await query.json();
  const data = json.routes[0];
  const route = data.geometry.coordinates;
  const geojson = {
    type: 'Feature',
    properties: {},
    geometry: {
      type: 'LineString',
      coordinates: route
    }
  };
  // if the route already exists on the map, we'll reset it using setData
  if (map.getSource('route')) {
    map.getSource('route').setData(geojson);
  }
  // otherwise, we'll make a new request
  else {
    map.addLayer({
      id: 'route',
      type: 'line',
      source: {
        type: 'geojson',
        data: geojson
      },
      layout: {
        'line-join': 'round',
        'line-cap': 'round'
      },
      paint: {
        'line-color': '#00ABFF',
        'line-width': 5,
        'line-opacity': 0.75
      }
    });
  }

	//add icon
	map.addLayer({
    id: 'point',
    type: 'circle',
    source: {
      type: 'geojson',
      data: {
        type: 'FeatureCollection',
        features: [
          {
            type: 'Feature',
            properties: {},
            geometry: {
              type: 'Point',
              coordinates: startLocation
            }
          }
        ]
      }
    },
    paint: {
      'circle-radius': 10,
      'circle-color': '#EA1C24'
    }
  });

  //fly to start location
  isFlying = true;
  map.flyTo({
		center: startLocation,
		speed: 0.5,
		zoom: 15
	});

  //flyto callback
	map.on('moveend', () => {
		if (isFlying) {
			isFlying = false;
    	animatePath(geojson.geometry.coordinates);
		}
	});

  console.log(geojson.geometry.coordinates);
}


